/* Replace:
   "?query=xxx#fragment" OR "#fragment" 
   with:
   "?fragment" OR "&fragment"

  /page.html?param=xxx#fragment=xxx  >> /page.html?param=xxx&fragment=xxx
  /page.html#fragment=xxx&param=xxx  >> /page.html?param=xxx&fragment=xxx
  /page.html#fragment=xxx?param=xxx  >> /page.html?param=xxx&fragment=xxx
  /page.html?param=xxx  >> /page.html?param=xxx
  /page.html#fragment=xxx  >> /page.html?fragment=xxx

*/

function() {
  var pageQuery = {{Page URL Query}};
  var pageHashFragment = {{Page URL Hash Fragment}};
  pageHashFragment = (pageHashFragment) ? pageHashFragment.replace("?", "&") : undefined;

  if(pageQuery && pageHashFragment) {
    return "?" + pageQuery + "&" + pageHashFragment; // ?param=xxx#fragment=xxx changed to ?param=xxx&fragment=xxx
  } 
  else if(pageQuery) {
    return "?" + pageQuery; // ?param=xxx
  }
  else if(pageHashFragment) {
    return "?" + pageHashFragment; // #fragment=xxx changed to ?fragment=xxx 
  }
  else {
     return ""; // else return - empty string
  }
}

